Access control for LoadBalancer can be controlled with following annotations: vks.vngcloud.vn/scheme specifies whether your LoadBalancer will be internet facing. vks.vngcloud.vn/scheme: "internal" vks.vngcloud.vn/inbound-cidrs specifies the CIDRs that are allowed to access LoadBalancer. vks.vngcloud.vn/inbound-cidrs: "10.0.0.0/24" vks.vngcloud.vn/security-groups specifies the securityGroups you want to attach to Node. ⚠️ Warnings : If you NOT specify this annotation, the controller will automatically create one security group, the security group will be attached to the Node and allow access from inbound-cidrs to the listen-ports. ⚠️ Warnings : If you specify this annotation, you need to ensure the security groups on your Node to allow inbound traffic from the load balancer. ⚠️ Warnings : If you specify this annotation, it'll configure only security group only include in this annotation. Ensure include them all here. vks.vngcloud.vn/security-groups: "sg-xxxx,sg-yyyyy" vks.vngcloud.vn/idle-timeout-client Connection idle timeout is the maximum time a connection can remain open without any data transfer, after which the load balancer will close the connection. Range: (1-3600). vks.vngcloud.vn/idle-timeout-client: "51" vks.vngcloud.vn/idle-timeout-member Backend member inactivity timeout in seconds. Range: (1-3600). vks.vngcloud.vn/idle-timeout-member: "51" vks.vngcloud.vn/idle-timeout-connection Backend member connection timeout in seconds. vks.vngcloud.vn/idle-timeout-connection: "5" vks.vngcloud.vn/certificate-ids specifies the certificates will be use in HTTPS listeners. ⚠️ Warnings : If you specify .Spec.TLS in your ingress resource, this annotation is requires to config certificate default for HTTPS listener. ⚠️ Warnings : The first secret in list will be the default certificate, the other will in SNI cert list. vks.vngcloud.vn/certificate-ids: "secret-xxx, secret-yyy" vks.vngcloud.vn/header specifies the header for HTTP and HTTPS listeners. ⚠️ Warnings : If you specify in wrong format, the consequences will be unpredictable. ⚠️ Warnings : You should choose the header allowed in portal. vks.vngcloud.vn/header: "{"http":["X-Forwarded-For", "X-Forwarded-Proto", "X-Forwarded-Port"],"https":["X-Forwarded-For", "X-Forwarded-Proto", "X-Forwarded-Port","X-SSL-Client-Verify","X-SSL-Client-Has-Cert","X-SSL-Client-DN","X-SSL-Client-CN","X-SSL-Issuer","X-SSL-Client-SHA1","X-SSL-Client-Not-Before","X-SSL-Client-Not-After"]}" vks.vngcloud.vn/client-certificate-id specifies the client certificate authentication will be use in HTTPS listener. vks.vngcloud.vn/client-certificate-id: "secret-xxx" vks.vngcloud.vn/implementation-specific-params specifies the policy when use ImplementSpecific PathType. This annotation is an array of JSON objects, each object contains the path, rules (compare type HOST_NAME, PATH), and action (REJECT, REDIRECT_TO_URL, REDIRECT_TO_POOL). JSON format value: [ { "path": "/haha", // this value should match path value "rules": [ { "type": "PATH", // HOST_NAME, PATH "compare": "EQUAL_TO", // CONTAINS, EQUAL_TO, REGEX, STARTS_WITH, ENDS_WITH "value": "/foo#" // value to compare }, { "type": "PATH", "compare": "REGEX", "value": "/foo#anchor" } // more rules ... ], "action": { "action": "REJECT" // REJECT, REDIRECT_TO_URL, REDIRECT_TO_POOL "redirectUrl": "https://example.com", // required when action is REDIRECT_TO_URL "redirectHttpCode": 301, // required when action is REDIRECT_TO_URL "keepQueryString": true // required when action is REDIRECT_TO_URL } }
] ⚠️ Warnings : If you specify in wrong format, the consequences will be unpredictable. For example, when you have a rule use ImplementSpecific PathType, you can use this annotation to specify the policy for this rule. spec: rules: - host: "a-1.vngcloud.vn" http: paths: - path: /haha # this value should match in annotation pathType: ImplementationSpecific backend: service: name: netperf-service port: number: 80 # To create a policy REJECT for this rule, you can use this example:
vks.vngcloud.vn/implementation-specific-params: '[{"path":"/haha","rules":[{"type":"PATH","compare":"EQUAL_TO","value":"/foo#"}],"action":{"action":"REJECT"}}]' # To create a policy REDIRECT_TO_URL for this rule, you can use this example:
vks.vngcloud.vn/implementation-specific-params: '[{"path":"/haha","rules":[{"type":"PATH","compare":"EQUAL_TO","value":"/foo#"}],"action":{"action":"REDIRECT_TO_URL","redirectUrl":"https://example.com","redirectHttpCode":301,"keepQueryString":true}}]' # To create a policy REDIRECT_TO_POOL for this rule, you can use this example:
vks.vngcloud.vn/implementation-specific-params: '[{"path":"/haha","rules":[{"type":"PATH","compare":"EQUAL_TO","value":"/foo#"}],"action":{"action":"REDIRECT_TO_POOL"}}]'
